  .btn.outline{background:transparent;color:var(--fg);border:1px solid var(--line)}
  footer{padding:14px;border-top:1px solid var(--line);color:var(--muted);text-align:center;font-size:13px}
  @media print{
    .bar, footer{display:none}
    .wrap{height:100vh}
  }
</style>
